The Ministry of Education (MoE) was established in 1951 and was renamed as the Ministry of Education and Sports (MoES) in 2002. It was again renamed as Ministry of Education with the decision of Cabinet in 15 Bhadra 2065 BS. The MoE as the apex body of all educational organizations is responsible for overall development of education in the country. This Ministry is responsible for formulating educational policies and plans and managing and implementing them across the country through the institutions under it.</p>

<p>The Central Level Agencies (CLAs) under the Ministry are responsible for designing and implementing of programmes and monitoring them. Five Regional Education Directorates (REDs) are responsible for monitoring the programmes undertaken by the district level organizations. Seventy-five District Education Offices (DEOs) and One Thousand Ninety-one Resource Centres (RCs) at local level are mainly the implementing agencies of the educational policies, plans and programmes. Moreover, all the functional units of the MoE and other constituent and autonomous bodies within the framework of the Ministry are parts of the organizational structure geared for achieving its goals and carry out its functions.</p>', '', '1', '', 'about us', '', '', '204', '2019-03-31 12:22:02', '2019-06-06 10:33:35', ''), 
