1 9 5 9 मा शिक्षा मंत्रालय (एमईई) स्थापना गरिएको थियो र 2002 मा शिक्षा र खेल मंत्रालय (मोईई) को रूपमा पुनःनामाकरण गरिएको थियो। यो फेरि 15 भद्र 2065 बीएसमा कैबिनेटको निर्णय संग शिक्षा मंत्रालयको रूपमा पुन: नामाकरण गरिएको थियो। सबै शैक्षिक संगठनहरूको सर्वोच्च निकायको रूपमा मोईई देशमा शिक्षाको समग्र विकासको लागि उत्तरदायी छ। यो मंत्रालय शैक्षिक नीतिहरु र योजनाहरु को निर्माण गर्न को लागी जिम्मेदार छ र उनको प्रबंधन को माध्यम ले संस्थाहरु को माध्यम ले उनलाई देश भर मा लागू गर्न को लागी।</p>

<p>कार्यक्रम अन्तर्गत केन्द्रीय स्तर एजेन्सीहरू (CLAs) कार्यक्रमहरूको डिजाइन र कार्यान्वयन गर्न जिम्मेवार छन् र तिनीहरूलाई निगरानी गर्दछ। जिल्ला क्षेत्रीय शिक्षा संस्थाहरूले कार्यक्रम सञ्चालन गर्ने पाँच क्षेत्रीय शिक्षा निदेशालय (आरईडी) जिम्मेवार छन्। स्थानीय तहमा 50 भन्दा बढी जिला शिक्षा कार्यालय (डीओ) र एक हजारौं नब्बे एक संसाधन केन्द्र (आरसी) मुख्यतः मुख्यतः शैक्षिक नीतिहरू, योजनाहरू र कार्यक्रमहरूको लागी लागू एजेन्सीहरू हुन्। यसबाहेक, मंत्रालयको ढाँचा भित्रको मोई र अन्य अवधारणा र स्वायत्त निकायका सबै कार्यात्मक इकाइहरू आफ्नो लक्ष्य प्राप्त गर्न र यसको कार्यहरू पूरा गर्न गठित संगठनात्मक ढाँचाका भाग हुन्।</p>', '', '1', '', 'about us', '', '', '17', '2019-03-31 12:22:02', '2019-06-03 13:23:37', ''), 
